	"zone_reglementaire_pays_SYMBO_6-18_PYR_PNG_FXX_WM_WMTS_20150410":{"title":"Pays","format":"image/png","tilematrix":"PM","style":"normal","minZoom":6,"maxZoom":17,"bbox":[-5.1504726,41.32521,9.570543,51.099052],"desc":"Le \"pays\" est un groupement de collectivités territoriales formant un territoire présentant une \"cohésion géographique, économique, culturelle ou sociale à l'échelle d'un bassin de vie ou d'emploi\". Les pays peuvent être représentés et gérés sous différentes formes juridiques : syndicat mixte de pays, association, groupement d'intérêt public... Leur financement provient de la participation de leurs membres (EPCI, communes isolées) et de contrats avec le département, la Région, l'État, l'Union européenne.","keys":"Etat et collectivités","legend":[null],"originators":{"IGN":{"href":"http://www.ign.fr","attribution":"Institut national de l'information géographique et forestière","logo":"http://wxs.ign.fr/static/logos/IGN/IGN.gif","minZoom":6,"maxZoom":17,"bbox":[-5.1504726,41.32521,9.570543,51.099052]},"CGET":{"href":"http://www.cget.gouv.fr/","attribution":"Commissariat général à l'égalité des territoires","logo":"http://wxs.ign.fr/static/logos/CGET/CGET.gif","minZoom":6,"maxZoom":17,"bbox":[-5.1504726,41.32521,9.570543,51.099052]}}},
