	"PHOTOHISTO-1950-1965_PYR-PNG_WLD_WM_WMTS4":{"title":"Photographies aériennes historiques 1950-1965","format":"image/png","tilematrix":"PM","style":"normal","minZoom":6,"maxZoom":18,"bbox":[-54.259003,-21.390581,55.583256,50.5054],"desc":"Couverture en photographes aériennes de la France des années 50, telle qu'elle se présentait avant les grands aménagements des années 60. Cette couverture a été réalisée à partir des photographies aériennes historiques numérisées par l'IGN. Elle est disponible sur la France métropolitaine, les départements et régions d'Outre-Mer (la Guyane n’est que partiellement couverte) et les collectivités d’Outre-Mer sauf la Polynésie française. Les photographies sont orthorectifiées, c'est-à-dire corrigées des déformations dues à la prise de vue et au relief du terrain, et assemblées pour fournir une visualisation continue superposable avec le Référentiel à Grande Echelle (RGE®).","keys":"Photographies","legend":[null],"originators":{"MEN":{"href":"http://www.education.gouv.fr","attribution":"Ministère de l’Education nationale","logo":"http://wxs.ign.fr/static/logos/MEN/MEN.gif","minZoom":18,"maxZoom":6,"bbox":[-54.13206,-21.390581,55.583256,50.5054]},"IGN":{"href":"http://www.ign.fr","attribution":"Institut national de l'information géographique et forestière","logo":"http://wxs.ign.fr/static/logos/IGN/IGN.gif","minZoom":18,"maxZoom":6,"bbox":[-54.259003,-21.390581,55.583256,50.5054]}}},
