			"SPOT5_PYR-JPEG_WLD_WM_20120624":{"title":"Spot 5","format":"image/jpeg","tilematrix":"PM","style":"normal","minZoom":6,"maxZoom":16,"bbox":[-2,42.000065,4.999905,46],"desc":"Cette couche est formée d'images prises par le satellite SPOT 5 en 2009 et 2010 depuis une altitude de 800 km. La résolution des images initiales est de 2,5 mètres/pixel, ce qui permet d'identifier l'existence de bâtiments, routes et chemins, et sa précision est homogène avec celle du référentiel à Grande Echelle. Le satellite SPOT 5 est exploité depuis 2002 par le Centre national d'études spatiales (CNES) et les images sont distribuées par la société Spot Image (Astrium GEO-Information Services). L'expertise de l'IGN menée à la demande du CNES a permis d'affiner les performances géométriques du capteur SPOT5, dans l'intérêt de tous les utilisateurs. La couche \" SPOT 5 \" visible sur Géoportail est issue de la co-édition Reference3D® entre Spot Image et l'IGN. Aucune légende n'est associée à cette couche. La radiométrie des images est traitée par des couleurs naturelles.","keys":"Photographies","legend":[],"originators":{"IGN":{"href":"http://www.ign.fr","attribution":"Institut national de l'information géographique et forestière","logo":"http://wxs.ign.fr/static/logos/IGN/IGN.gif","minZoom":6,"maxZoom":16,"bbox":[-2,42.000065,4.999905,46]},"CNES":{"href":"http://www.cnes.fr/","attribution":"Centre national d'études spatiales (CNES)","logo":"http://wxs.ign.fr/static/logos/CNES/CNES.gif","minZoom":6,"maxZoom":16,"bbox":[-2,42.000065,4.999905,46]},"ASTRIUM":{"href":"http://www.astrium-geo.com/","attribution":"Astrium","logo":"http://wxs.ign.fr/static/logos/ASTRIUM/ASTRIUM.gif","minZoom":6,"maxZoom":16,"bbox":[-2,42.000065,4.999905,46]}}},
